caption.paragraph:
Fig. 7.

Philopterus gustafssoni

sp. nov.
ex 

Regulus regulus

(MMBC CZ-OS01): nomenclature of male leg chaetotaxy, dorsal and ventral views. Abbreviations: 
c
– coxa; 
t
– trochanter; 
f
– femur; 
dm
– distal marginal seta; 
d
– dorsal seta; 
a
– anterior seta; 
p
– posterior seta; 
s
– sensillus; 
v
– ventral seta. Scale bar: 0.1 mm.

subSubSection.paragraph:
The odd medium-long seta shown in the left part of the female subgenital plate (
Fig. 6F
) is not always present. Here it is included in the illustration because it is present in the specimen used for the drawing.
